import React from "react";

const Question = (question) => {
  return (
    <tr>
      <td>{question.id}</td>
      <td>{question.title}</td>
      <td className="description">{question.description}</td>
      <td>{question.category}</td>
      <td>{question.complexity}</td>
    </tr>
  );
};

export default Question;
